SET FOREIGN_KEY_CHECKS = 1;

-- ============================================================================
-- VERIFICATION QUERIES
-- ============================================================================

-- Count total customers
SELECT COUNT(*) AS total_customers FROM customers;

-- Count invalid emails (missing @ or domain)
SELECT COUNT(*) AS invalid_emails 
FROM customers 
WHERE email IS NOT NULL 
  AND (email NOT LIKE '%@%' OR email NOT LIKE '%@%.%');

-- Count missing emails
SELECT COUNT(*) AS missing_emails 
FROM customers 
WHERE email IS NULL;

-- Count invalid phones
SELECT COUNT(*) AS invalid_phones 
FROM customers 
WHERE phone IS NOT NULL 
  AND phone NOT REGEXP '^[0-9]{3}-[0-9]{4}$';

-- Count missing addresses
SELECT COUNT(*) AS missing_addresses 
FROM customers 
WHERE address IS NULL;

-- Count duplicate emails
SELECT email, COUNT(*) AS duplicate_count 
FROM customers 
WHERE email IS NOT NULL
GROUP BY email 
HAVING COUNT(*) > 1
ORDER BY duplicate_count DESC;

-- Summary statistics
SELECT 
    COUNT(*) AS total_records,
    SUM(CASE WHEN email IS NULL THEN 1 ELSE 0 END) AS null_emails,
    SUM(CASE WHEN email IS NOT NULL AND (email NOT LIKE '%@%' OR email NOT LIKE '%@%.%') THEN 1 ELSE 0 END) AS invalid_emails,
    SUM(CASE WHEN phone IS NOT NULL AND phone NOT REGEXP '^[0-9]{3}-[0-9]{4}$' THEN 1 ELSE 0 END) AS invalid_phones,
    SUM(CASE WHEN address IS NULL THEN 1 ELSE 0 END) AS null_addresses
FROM customers;

